import React from "react";

import "./Colaborador.css";

const Colaborador = () => {
  return (
    <div>
      <div>
        <img src="https://github.com/JFBatista023.png" alt="João Filipe" />
      </div>
      <div>
        <h4>João Filipe</h4>
        <h5>Estagiário</h5>
      </div>
    </div>
  );
};

export default Colaborador;
